PROPERTY OVERVIEW
Available immediately; 8,400 SF with 980 SF of finished office at $4.75 PSF (Mod. Gross Lease). The office has been remodel and has LED lighting
PROPERTY HIGHLIGHTS
• The warehouse is 7,420 SF;
• The finished office area is 980 SF, which includes a reception area, three offices, open area and two restrooms;
• For lease at $4.75 PSF (mod. gross - tenant pays increases in taxes & insurance;
• Tenant maintains the interior of the space;
• Two dock doors (8' x 10') and one G/L door (10' x 10' with power);
• Ceiling height: 20';
• Column spacing: 50' / 24'';
• The warehouse lighting is LED;
• Warehouse has skylights

Includes Office space with 987± SF
One 12' x 14' Recessed Dock Door
Centrally located with immediate Interstate/Highway access via I-29, I-35, Hwy 9, I-70 & Hwy 210;
No Earnings Tax & one of the lowest tax schedules in the region;
High speed fiber-optic internet service available throughout North Kansas City;
3 minute drive from Charles B. Wheeler Downtown Airport and Downtown Kansas City; 15 minutes from Kansas City International Airport;
Public transportation via regional bus system and bike share stations;
Walkability to restaurants, shops, breweries and entertainment in downtown North Kansas City.
